  `wuLiRank` int(8) DEFAULT NULL COMMENT '物理排名',
  `wuLiIsWeek` int(2) DEFAULT NULL COMMENT '物理是否弱势学科 0 正常 1是弱势科目',
  `huaXueExScore` double(8,2) DEFAULT NULL COMMENT '化学赋分成绩',
  `huaXueRank` int(8) DEFAULT NULL COMMENT '化学排名',
  `huaXueIsWeek` int(2) DEFAULT NULL COMMENT '化学是否弱势学科 0 正常 1是弱势科目',
  `shengWuExScore` double(8,2) DEFAULT NULL COMMENT '生物赋分成绩',
  `shengWuRank` int(8) DEFAULT NULL COMMENT '生物排名',
  `shengWuIsWeek` int(2) DEFAULT NULL COMMENT '生物是否弱势学科 0 正常 1是弱势科目',
  `zhengZhiExScore` double(8,2) DEFAULT NULL COMMENT '政治赋分成绩',
  `zhengZhiRank` int(8) DEFAULT NULL COMMENT '政治排名',
  `zhengZhiIsWeek` int(2) DEFAULT NULL COMMENT '政治是否弱势学科 0 正常 1是弱势科目',
  `diLiExScore` double(8,2) DEFAULT NULL COMMENT '地理赋分成绩',
  `diLiRank` int(8) DEFAULT NULL COMMENT '地理排名',
  `diLiIsWeek` int(2) DEFAULT NULL COMMENT '地理是否弱势学科 0 正常 1是弱势科目',
  `liShiExScore` double(8,2) DEFAULT NULL COMMENT '历史赋分成绩',
  `liShiRank` int(8) DEFAULT NULL COMMENT '历史排名',
  `liShiIsWeek` int(2) DEFAULT NULL COMMENT '历史是否弱势学科 0 正常 1是弱势科目',
  `jiShuExScore` double(8,2) DEFAULT NULL COMMENT '技术赋分成绩',
  `jiShuRank` int(8) DEFAULT NULL COMMENT '技术排名',
  `jiShuIsWeek` int(2) DEFAULT NULL COMMENT '技术是否弱势学科 0 正常 1是弱势科目',
  `status` tinyint(4) DEFAULT NULL COMMENT '状态 0:正常 -1:删除',
  `publisher` varchar(32) DEFAULT NULL COMMENT '创建人',
  `createDate` bigint(20) DEFAULT NULL COMMENT '创建时间',
  `lastModifier` varchar(32) DEFAULT NULL COMMENT '最后修改人',
  `lastModDate` bigint(20) DEFAULT NULL COMMENT '最后修改时间',
  PRIMARY KEY (`id`),
  KEY `INDEX_SCOREDID` (`scoreId`),
  KEY `INDEX_DETAILID` (`detailId`)
) ENGINE=InnoDB AUTO_INCREMENT=78518 DEFAULT CHARSET=utf8 COMMENT='科室信息|科室信息|用户中心|CreateBaseDomain\n科室信息表';

