-- ----------------------------
--  Table structure for `score_score_detail`
-- ----------------------------
DROP TABLE IF EXISTS `score_score_detail`;
CREATE TABLE `score_score_detail` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `scoreId` varchar(32) NOT NULL COMMENT '成绩列表Id',
  `detailId` varchar(32) NOT NULL COMMENT '科目成绩明细',
  `schoolId` int(11) DEFAULT NULL COMMENT '学校Id',
  `studentId` bigint(20) DEFAULT NULL COMMENT '学生Id',
  `yuWenScore` double(8,2) DEFAULT NULL COMMENT '语文成绩',
  `shuXueScore` double(8,2) DEFAULT NULL COMMENT '数据成绩',
  `yingYuScore` double(8,2) DEFAULT NULL COMMENT '英语成绩',
  `wuLiScore` double(8,2) DEFAULT NULL COMMENT '物理成绩',
  `huaXueScore` double(8,2) DEFAULT NULL COMMENT '化学成绩',
  `shengWuScore` double(8,2) DEFAULT NULL COMMENT '生物成绩',
  `zhengZhiScore` double(8,2) DEFAULT NULL COMMENT '政治成绩',
  `diLiScore` double(8,2) DEFAULT NULL COMMENT '地理成绩',
  `liShiScore` double(8,2) DEFAULT NULL COMMENT '历史成绩',
  `jiShuScore` double(8,2) DEFAULT NULL COMMENT '技术成绩',
  `remark` int(8) DEFAULT NULL COMMENT '成绩排名',
  `status` tinyint(4) DEFAULT NULL COMMENT '状态 0:正常 -1:删除',
  `publisher` varchar(32) DEFAULT NULL COMMENT '创建人',
  `createDate` bigint(20) DEFAULT NULL COMMENT '创建时间',
  `lastModifier` varchar(32) DEFAULT NULL COMMENT '最后修改人',
  `lastModDate` bigint(20) DEFAULT NULL COMMENT '最后修改时间',
  PRIMARY KEY (`id`),
  KEY `index_scoreId` (`scoreId`),
  KEY `index_detailId` (`detailId`),
  KEY `index_studentId` (`schoolId`,`studentId`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=65112 DEFAULT CHARSET=utf8 COMMENT='科室信息|科室信息|用户中心|CreateBaseDomain\n科室信息表';

