-- ----------------------------
--  Table structure for `score_score_task`
-- ----------------------------
DROP TABLE IF EXISTS `score_score_task`;
CREATE TABLE `score_score_task` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `scoreId` varchar(32) NOT NULL COMMENT '成绩列表Id',
  `schoolId` int(11) DEFAULT NULL COMMENT '学校Id',
  `gradeYearId` bigint(20) DEFAULT NULL COMMENT '对应年级表里的id',
  `grade` varchar(64) DEFAULT NULL COMMENT '年级',
  `examName` varchar(64) DEFAULT NULL COMMENT '考试名称',
  `fileUrl` varchar(64) DEFAULT NULL COMMENT '文件路径',
  `studentNum` int(8) DEFAULT NULL COMMENT '学生人数',
  `scoreStudentNum` int(8) DEFAULT NULL COMMENT '已上传学生人数',
  `status` tinyint(4) DEFAULT NULL COMMENT '状态 0:正常 -1:删除',
  `publisher` varchar(32) DEFAULT NULL COMMENT '创建人',
  `createDate` bigint(20) DEFAULT NULL COMMENT '创建时间',
  `lastModifier` varchar(32) DEFAULT NULL COMMENT '最后修改人',
  `lastModDate` bigint(20) DEFAULT NULL COMMENT '最后修改时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=213 DEFAULT CHARSET=utf8 COMMENT='科室信息|科室信息|用户中心|CreateBaseDomain\n科室信息表';

