-- ----------------------------
--  Table structure for `student_student_base`
-- ----------------------------
DROP TABLE IF EXISTS `student_student_base`;
CREATE TABLE `student_student_base` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `studentCode` varchar(32) NOT NULL COMMENT '学生code 唯一',
  `schoolId` int(11) DEFAULT NULL COMMENT '学校Id',
  `grade` varchar(32) DEFAULT NULL COMMENT '年级',
  `studentId` bigint(20) DEFAULT NULL COMMENT '学生id 对应学生基础表student_no',
  `studentName` varchar(64) DEFAULT NULL COMMENT '学生名称',
  `sex` int(4) DEFAULT NULL COMMENT '学生性别 0:女生 1:男生',
  `studentLevel` varchar(8) DEFAULT NULL COMMENT '学生层级 暂定:A,B,C,D,E',
  `enrolYear` varchar(32) DEFAULT NULL COMMENT '入学年份',
  `composeId` varchar(32) DEFAULT NULL COMMENT '组合选课id',
  `status` tinyint(4) DEFAULT NULL COMMENT '状态 0:正常 -1:删除',
  `publisher` varchar(32) DEFAULT NULL COMMENT '创建人',
  `createDate` bigint(20) DEFAULT NULL COMMENT '创建时间',
  `lastModifier` varchar(32) DEFAULT NULL COMMENT '最后修改人',
  `lastModDate` bigint(20) DEFAULT NULL COMMENT '最后修改时间',
  PRIMARY KEY (`id`),
  KEY `index_studentId` (`studentId`),
  KEY `index_schoolId` (`schoolId`)
) ENGINE=InnoDB AUTO_INCREMENT=34681 DEFAULT CHARSET=utf8 COMMENT='科室信息|科室信息|用户中心|CreateBaseDomain\n科室信息表';

